import Card from "../../../ui/card/Card";
import "./name.scss";

function Name(props: { name: string; role: string }) {
  return (
    <Card className="name">
      <div className="name__container">
        <p className="name__container-name">{props.name}</p>
        <p className="name__container-role">{props.role}</p>
      </div>
    </Card>
  );
}

export default Name;
